        <Login />
      </div>
      <section style={{ height: '30vh', textAlign: 'center' }}>
        <h1> Ludis</h1>
        <div className="info">
          <p>
            Ludis is a platform built to connect people. Ludis is building a strong and vibrant community of athletes that brings you transparency, information, and knowledge of the platform's features.
            <br />
            Soâ€¦we are looking for people to test this Ludis platform and start this new community, which is still in beta. Get involved and join the fun!
            <br />
            Use the built-in message and chat features to communicate with other members, participate in group discussions, ask questions and give suggestions.
            <br />
            Feel free to drop us a message ludis@ludis.com
